import React, {Component} from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import { Multiselect } from "multiselect-react-dropdown";
import '././css/Stock.css';

const sports = [ ];

class Stock extends Component {
	state = { value: ["Baseball", "Basketball", "Cricket", "Field Hockey", "Football", "Table Tennis", "Tennis", "Volleyball" ]};
	oneChange = (event) =>{
		this.setState({
			value: [...event.target.value]
		});
	}
	render(){
		return(
			<div>
				<h className ="title"> United States Stocks </h>

				<Container className = "filter-title">
					<Row>
						<Col> 
							Market 
							<div className="example-wrapper">
								<div className = "filter"> United States &#9660; </div>
								<Multiselect
			                        data={this.state}
			                        onChange={this.onChange}
			                        value={this.state.value}
		                    	/>
							</div>
						</Col>
						<Col> 
							Industry 
							<div className = "filter"> Technology &#9660; </div>
						</Col>
						<Col className ='more-filter'> More Filters </Col>
					</Row>
				</Container>
			</div>

		);
	}
}

export default Stock;
